module.exports = JSON.parse('[{"id":13,"unique_id":"web-2-id-13-500x470-web-clinic","title":{"small":"Efficient, user-friendly, and secure dental clinic management solution","big":"Dental Clinic Website with Appointment Booking System"},"clientURLLink":"","projectHeaderImage":"https://res.cloudinary.com/drrlu7qrl/image/upload/f_auto,q_auto/v1677400532/futureflowit.com/projects/Mobile%20App%20Background%20Image/pexels-max-mishin-11026126_vpsmjy.jpg","videoLink":"https://vimeo.com/127203262","clientURLName":"Clinic Owner","date":"December 2020","categories":[{"id":1,"name":"Health Care Management","link":"#"}],"tags":[{"id":1,"name":"React","link":"#"},{"id":2,"name":"Node","link":"#"}],"intro":{"content":"I have make this website while working in Future Flow IT, we take pride in delivering innovative and custom-made digital solutions for businesses. Our Dental Clinic website is an all-in-one solution that streamlines and simplifies dental clinic management, from appointment booking to patient record keeping and beyond. Built using the latest technologies, including React.js and Node.js, this website is designed to be responsive, user-friendly, and secure","spmList":[]},"gallery":["https://res.cloudinary.com/drrlu7qrl/image/upload/f_auto,q_auto,w_600,h_600,c_scale/v1677685726/futureflowit.com/projects/1.%20Web%20Projects/2.%20Web_Clinic/2.%20Web_clinic_600x600/1_y0sdka.png","https://res.cloudinary.com/drrlu7qrl/image/upload/f_auto,q_auto,w_600,h_600,c_scale/v1677685726/futureflowit.com/projects/1.%20Web%20Projects/2.%20Web_Clinic/2.%20Web_clinic_600x600/2_d65dhp.png","https://res.cloudinary.com/drrlu7qrl/image/upload/f_auto,q_auto,w_600,h_600,c_scale/v1677685726/futureflowit.com/projects/1.%20Web%20Projects/2.%20Web_Clinic/2.%20Web_clinic_600x600/3_grz6ve.png","https://res.cloudinary.com/drrlu7qrl/image/upload/f_auto,q_auto,w_600,h_600,c_scale/v1677685727/futureflowit.com/projects/1.%20Web%20Projects/2.%20Web_Clinic/2.%20Web_clinic_600x600/4_dujbu4.png"],"description":{"content":"This Dental Clinic website is an end-to-end solution for dental clinics of any size. It includes a range of features, such as appointment scheduling, patient registration and record keeping, secure data management, and more. With our website, patients can easily book appointments, update their information, and access their dental records. Dental clinic staff can manage appointments, check patient records, and communicate with patients seamlessly. Our website helps improve the efficiency and productivity of dental clinics while enhancing the patient experience.","spmList":[{"id":1,"title":"Appointment Booking System","name":"Patients can easily book appointments with dentists through the website\'s user-friendly interface. They can select the type of service they require, choose a date and time, and receive a confirmation message once the appointment is confirmed."},{"id":2,"title":"Patient Record Management","name":"The website includes a feature for managing patient records, including their medical history and treatment plans. This feature enables dentists to easily access patient information, view their treatment history, and make informed decisions about their care."},{"id":3,"title":"Responsive Design","name":"The website is designed to be responsive and compatible with different devices, including mobile phones, tablets, and desktops. This ensures that patients can easily access the website and book appointments, regardless of the device they are using."},{"id":4,"title":"Secure Login System","name":"The website includes a secure login system that ensures patient information is kept private and confidential. Patients can create an account to manage their appointments and view their medical records."},{"id":5,"title":"Easy-to-Use Interface","name":"The website has a user-friendly interface that is easy to navigate, with clear and concise information about the clinic and its services. Patients can easily find the information they need and book appointments with just a few clicks."}]}}]');

